        function findMin(data) {
            let minIndex = 0;
            let minValue = Infinity;
            for(let i = 0; i < data.length; i++) {
                if(data[i] < minValue) {
                    minIndex = i;
                    minValue = data[i];
                }
            }

            return {minIndex, minValue};
        }

        function findMax(data) {
            let maxIndex = 0;
            let maxValue = -Infinity;
            for(let i = 0; i < data.length; i++) {
                if(data[i] > maxValue) {
                    maxIndex = i;
                    maxValue = data[i];
                }
            }

            return {maxIndex, maxValue};
        }
        
        function drawData(canvas, data) {
            const ctx = canvas.getContext('2d');
            ctx.clearRect(0, 0, canvas.width, canvas.height); // Clear the canvas before drawing
            ctx.strokeStyle = "black";
            ctx.beginPath();
            ctx.moveTo(0, data[0]);

            // Find min and max values in data to scale it to canvas height
            const min = Math.min(...data);
            const max = Math.max(...data);
            
            // Scale function to map data[i] to canvas height
            const mapToCanvasY = (value) => {
                return canvas.height - ((value - min) / (max - min)) * canvas.height;
            };

            for (let i = 0; i < Math.min(data.length, canvas.width); i++) {
                ctx.lineTo(i, mapToCanvasY(data[i]));
            }

            ctx.stroke(); // Draw the path
        }
